import React from 'react'


class TaskForm extends React.Component {
    render() {
        return (
            <form>
                <input type="text" placeholder="New Task Details"></input>
                <select>
                    <option>Code</option>
                    <option>Food</option>
                    <option>Money</option>
                    <option>Misc</option>
                </select>
                <input type="submit" value="Add Task"></input>
            </form>
        )
    }
}


export default TaskForm
